script: |
  super -f tsv -I q13709.sql | sort > q13709.out

vector: true

inputs:
  - name: q13709.sql
    data: |
      SELECT ALL col0 * + 33 - + col1 * - ( - col0 ) AS col0 FROM tab1 WHERE - col2 NOT BETWEEN - col0 * - col0 + - col1 + - - col1 * - col0 - - col1 * - col2 AND + - 46 * + col2 * + + col1;
  - name: tab1

outputs:
  - name: q13709.out
    data: |
      -1274
      2380
      969
